import pic1 from './images/pi1.png';
import pic2 from './images/pi2.png';
import pic3 from './images/pi3.png';

const Sdata = [
    {
        imgsrc:pic1,
        title:"Morning",
    },
    {
        imgsrc:pic2,
        title:"Night",
    },
    {
        imgsrc:pic3,
        title:"Hello",
    }
]
export default Sdata;
